/**
 * Masonry Block
 */
function initMasonry() {
  var $els = [].slice.call(document.querySelectorAll('.image-gallery--masonry, .masonry-grid'))

  $els.map( function($el){
    imagesLoaded( $el, function() {
      new Isotope( $el )
    } )
  } )
}

/**
 * Carousel
 */
function initCarousel() {
  $carousels = document.querySelectorAll('.icl-carousel');

  for ( var i = 0; i < $carousels.length; i++ ) {
  // $carousels.map( function($carousel) {
    var $carousel   = $carousels[i];
    var items       = $carousel.dataset.items;
    var controls    = $carousel.dataset.controls;
    var nav         = $carousel.dataset.nav;
    var gutter      = $carousel.dataset.gutter;
    var center      = $carousel.dataset.center;
    var slideBy     = $carousel.dataset.slideBy;
    var edgePadding = $carousel.dataset.edgePadding;
    var axis        = $carousel.dataset.axis;
    var mode        = $carousel.dataset.mode;

    if ( ! $carousel ) return
    var opts = {
      mode        : mode || 'carousel',
      container   : $carousel,
      items       : 1,
      nav         : nav,
      controls    : controls,
      slideBy     : slideBy,
      mouseDrag   : true,
      loop        : true,
      gutter      : gutter,
      center      : center,
      edgePadding : edgePadding,
      axis        : axis,
    }
    if ( center ) opts.edgePadding = 20

    if ( items >= 3 )
      opts.responsive = {
        640: { items: 2 },
        990: { items: items },
      }
    else if ( items >= 2  )
      opts.responsive = {
        640: { items: 1 },
        990: { items: items },
      }

    // console.log(opts);

    tns(opts);
  // } );
  }
}

( function( $ ){

  $( document ).on( 'click', '.navbar-burger', function() {
    var target  = $( this ).data( 'target' ),
        $target = $( '#' + target );

    // console.log(target);


    $( this ).toggleClass( 'is-active' );
    $target.toggleClass( 'is-active' );

  } );

  $(".form-wrapper").on('click', '.close-message' , function(){

    var successMessage = $(this).parents('.form-wrapper').find(".success-message");

    if ( successMessage.hasClass('is-cover') ) {
      successMessage.fadeOut();
      successMessage.parents('.icl-section').css('z-index', '1'); //reset block container z-index
    } else {
      successMessage.slideUp();
    }

    // delete link draft contract if exist (flow psb)
    let draftContract = document.querySelector('.success-message #link-draft-contract');
    if (draftContract) {
      draftContract.remove();
    }
  });

  // reset custom field in form
  function resetCustomField(){
    // regenerate or reset map (pin coordinate)
    if (mapLanding) {
      for(let i in mapLanding._layers){
        //remove previous marker
        if(mapLanding._layers[i] && mapLanding._layers[i]._id === 'pin-map-id'){
          mapLanding.removeLayer(mapLanding._layers[i]);
        }
      }
    }

    // clear ktp
    if (document.getElementById('ktp-field-value')) {
      document.getElementById('ktp-field-value').innerHTML = ''; 
      document.getElementById('ktp-field-canvas').style.display = 'none';
    }

    // clear selfie
    if (document.getElementById('selfie-field-value')) {
      document.getElementById('selfie-field-value').innerHTML = ''; 
      document.getElementById('selfie-field-canvas').style.display = 'none';
    }

    // clear signature
    if (document.getElementById('clear-sig')) {
      document.getElementById('clear-sig').click();
    }
  }

  function ajaxForm() {

    const getCookie = (cname) => {
      let name = cname + "=";
      let decodedCookie = decodeURIComponent(document.cookie);
      let ca = decodedCookie.split(';');
      for(let i = 0; i <ca.length; i++) {
        let c = ca[i];
        while (c.charAt(0) == ' ') {
          c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
          return c.substring(name.length, c.length);
        }
      }
      return "";
    }

    // auto full input userCode based on cookie
    if (getCookie('reff') && document.querySelector('.icl-form input[name="userCode"]')) {
      let userCodeInput = jQuery('.icl-form input[name="userCode"]');
      if (userCodeInput.length === 1) {
        userCodeInput[0].type = 'hidden';
        userCodeInput[0].value = getCookie('reff');
        userCodeInput.parents('.field.field-is-full').css('display', 'none');
      }
    }

    $('.icl-form').on('submit', function(e){
      e.preventDefault();

      const form           = $(this);
      const target         = $(this).attr("action") + "/ajax";
      const notice         = $(this).find('.icl-form-notice');
      const noticeContent  = notice.find('.icl-form-notice-content');
      const successMessage = $(this).find(".success-message");

      let inputField = $(this).find('input.input, select, textarea.textarea, radio');
      let fileField = $(this).find('input[type="file"]');

      const formData = new FormData();
      for (const field of inputField) {
        formData.append(field.name, field.value);
      }

      for (const field of fileField) {
        if (field.files.length===0 && field.required) {
          alert('Input file tidak boleh kosong');
          return;
        }
        else if (field.files.length>0 && field.files[0].size > 10240000){
          alert('Input file maksimal 10 MB');
          return;
        }
        else{
          formData.append(field.name, field.files[0])
        }
      }

      form.addClass('is-loading');

      const svgLoading = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" style="margin: auto; background: none; display: block; shape-rendering: auto;" width="20px" height="20px" viewBox="0 0 100 100" preserveAspectRatio="xMidYMid">
      <g>
        <path d="M50 15A35 35 0 1 0 74.74873734152916 25.251262658470843" fill="none" stroke="#ffffff" stroke-width="12"></path>
        <path d="M49 3L49 27L61 15L49 3" fill="#ffffff"></path>
        <animateTransform attributeName="transform" type="rotate" repeatCount="indefinite" dur="1s" values="0 50 50;360 50 50" keyTimes="0;1"></animateTransform>
      </g>
      <!-- [ldio] generated by https://loading.io/ --></svg>`;

      let submitBtn = $(this).find('button[type="submit"]');
      submitBtn = submitBtn.length > 0 ? submitBtn[0] : null;
      let submitText = submitBtn ? submitBtn.innerHTML : null;

      // parsing amanda cookies if exist. BE will parsing to mydita (in flow psb)
      let amandaCookie = getCookie('amdcode');
      if (amandaCookie.match(/^AMD\d\d\d\d\d\d\d\d$/i)) {
        formData.append('amdcode', amandaCookie.toUpperCase());
      }

      // parsing partnerId cookies if exist. BE will parsing to mydita (in flow psb)
      let partnerIdCookie = getCookie('partnerId');
      if (partnerIdCookie) {
        formData.append('partnerId', partnerIdCookie);
      }

      $.ajax({
        url: target,
        type: 'post',
        processData: false,
        contentType: false,
        cache: false,
        data: formData,
        enctype : 'multipart/form-data',
        beforeSend : function(){
          if (submitBtn) {
            submitBtn.innerHTML = `${submitText} ${svgLoading}`;
          }
        },
        success: function(data){
          if ( data.status ) {
            // default
            noticeContent.html('Halo, terima kasih telah menghubungi kami, kami akan mengontak anda kembali');
            notice.addClass('success is-active');
            if ( successMessage.hasClass('is-cover') ) {
              successMessage.fadeIn();
              successMessage.parents('.icl-section').css('z-index', '1000'); //change block container z-index
            } else {
              successMessage.slideDown();
            }
          } else {
            // default
            noticeContent.html(data.message);
            notice.addClass('error is-active');
          }

          if (submitBtn) {
            submitBtn.innerHTML = `${submitText}`;
          }

          // popup message (based on response message)
          let contentMessage = successMessage.find('.success-message-content-wrap');
          if (data.message) {
            contentMessage.html(data.message);
          }

          // show contract link if exist (flow psb)
          if (data.data && data.data.draftContract) {
            contentMessage.html(`
              ${contentMessage.html()} 
              <a class="button is-primary" href="${data.data.draftContract}" target="_blank" id="link-draft-contract" style="margin: 15px auto 0 auto;display: block;width: 150px;">
                Draft Contract
              </a>`
            );
          }

          // clear/reset field
          resetCustomField();
          form.trigger("reset");

          form.removeClass('is-loading');
        },
        error: function(res) {
          if (submitBtn) {
            submitBtn.innerHTML = `${submitText}`;
          }
          form.removeClass('is-loading');
          let message = res.responseJSON && res.responseJSON.message ? res.responseJSON.message : "Gagal mengirimkan pesan";
          alert( message );
        }
      });
    })
  }

  function showNotice() {
    if ( typeof ukm_notice === "undefined" ) return;

    var notice = document.createElement('DIV');
    var close  = document.createElement('BUTTON');

    notice.classList.add('ukm-notice');
    if ( ukm_notice.status ) {
      notice.classList.add('success');
    } else {
      notice.classList.add('error');
    }

    notice.innerHTML = ukm_notice.message;

    close.classList.add( 'ukm-notice__close' );
    close.innerHTML = '<i class="mdi mdi-close"></i>';
    notice.appendChild(close);

    document.body.appendChild( notice );

    var notice = document.querySelector('.ukm-notice');
    var closeBtn = document.querySelector('.ukm-notice__close');
    closeBtn.addEventListener( 'click', function() {
      notice.classList.add( 'closed' );
    } );

    setTimeout(function(){
      notice.classList.add( 'closed' )
    }, 5000);
  }

  $( document ).ready( function () {

    // Init lightbox
    $('[data-lightbox]').magnificPopup({
      type: 'image',
      closeOnContentClick: true,
      closeBtnInside: false,
      fixedContentPos: true,
      mainClass: 'mfp-no-margins mfp-with-zoom', // class to remove default margin from left and right side
      image: {
        verticalFit: true
      },
      zoom: {
        enabled: true,
        duration: 300 // don't foget to change the duration also in CSS
      }
    });

    $(document).on('click', '.icl-form-notice-close', function(e){
      e.preventDefault();
      $(this).parent().removeClass('is-active');
    });

    $('.icl-image-gallery, .icl-lightbox').each(function(){
      $(this).magnificPopup({
        delegate: 'a',
        type: 'image',
        closeOnContentClick: true,
        closeBtnInside: false,
        fixedContentPos: true,
        mainClass: 'mfp-no-margins mfp-with-zoom', // class to remove default margin from left and right side
        gallery: {
          enabled: true,
          navigateByImgClick: true,
          preload: [0,1] // Will preload 0 - before current, and 1 after the current image
        },
        image: {
          verticalFit: true,
          titleSrc: function(item) {
            return item.el.attr('title');
          }
        },
        zoom: {
          enabled: true,
          duration: 300 // don't foget to change the duration also in CSS
        }
      });
    });

    $( document ).on( 'click', '.accordion-title', function() {
      $(this).parent().toggleClass('is-active');
      $(this).next().slideToggle();
    } );

    $( document ).on( 'click', '.icl-pricing__detail-title', function() {
      $(this).toggleClass('is-active');
      $(this).next().slideToggle();
    } )

    initCarousel();

    initMasonry();

    ajaxForm();

    // var bgLoad = imagesLoaded('.icl-section__bg', { background: true })
    // bgLoad.on( 'progress', function( instance, image ) {
    //   var result = image.isLoaded ? 'loaded' : 'broken';
    //   image.element.classList.add('is-loaded')
    // });

  } );

  function enableForm(){
    var $controls = $(".icl-form").find('input, textarea, select, button');

    $controls.attr('disabled', false)

  }

  $(window).on( 'load', function() {
    AOS.init({once: true});

    showNotice();
    setTimeout(function(){
      enableForm();
    }, 1000)
    
  } );

}(jQuery));